import React from "react"
import "./contact.scss"

const contact = () => {
	return (
		<div className="fixed-navigation">
			<div className="github"></div>
			<div className="twitter"></div>
			<div className="linkedin"></div>
			<div className="email"></div>
		</div>
	)
}

export default contact
